import './Form.css';
import { React, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import * as actions from '../../redux/actions';

export default function Form(props) {
    const dispatch = useDispatch();

    useEffect(() => {
        dispatch(actions.getAllTemperaments())
    }, [dispatch])

    // const temperaments = useSelector(store => store.temperaments)

    const { input, setInput, handleInputChange, setErrors, handleSubmit } = props;

    return (
        <div className="formDiv">
            <form onSubmit={handleSubmit}>
                <label>Name: </label>
                <input
                    className='inputGral'
                    name='name'
                    type="text"
                    placeholder='Name of the dog breed...'
                    onChange={handleInputChange}
                    value={input.name} />
                <hr />
                <label>Image: </label>
                <input
                    className='inputGral'
                    name='image'
                    placeholder='Copy the url of a cool image of the dog...'
                    type='text'
                    onChange={handleInputChange} />
                <hr />
            </form>
        </div>
    )
}
